    false,nt"url": null,nt"notes": "This annual narrative report for Okefenokee
    and Banks Lake National Wildlife Refuges summarizes refuge activities during the
    1982 calendar year.  The report begins with a summary of the years highlights and
    climatic conditions.   Land acquisitionincluding fee title is also covered.  The
    report includes a planning section which discusses master plan, management plan,
    public participation, compliance with environmental mandates, research and investigations.
     Refuge administration is outlined; information about personnel, youth programs,
    other manpower programs, volunteer programs, funding, safety, technical assistance,
    and other items is given.  Habitat management is also covered.  Subjects include
    general, wetlands, forests, fire management, pest control, wilderness and special
    areas.  The wildlife section of the report discusses wildlife diversity, endangered
    andor threatened species, waterfowl, marsh and water birds, shorebirds, gulls, terns,
    and allied species, raptors, other migratory birds, game mammals, other resident
    wildlife, fisheries resources, marking and banding.  The public uses of the refuge
    described in this report include general, outdoor classrooms  students, outdoor
    classrooms  teachers, interpretive foot trails, interpretive tour routes, interpretive
    exhibitsdemonstrations, hunting, fishing, wildlife observation, camping, picnicking,
    law enforcement, cooperating associations, and concessions.  The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization and replacement, communications systems,
    and energy conservation.  Items of interest are provided at the end.",nt"license_title":
